export function dfs(grid, start, finish) {
  const stack = [];
  const path = [];

  stack.push(start);

  while (stack.length) {
    const curr = stack.pop();
    const [i, j] = [curr.row, curr.col];
    grid[i][j].isVisited = true;
  }
}
